import React, { useState, useEffect } from "react";
import {
  Box,
  Typography,
  CircularProgress,
  Paper,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
} from "@mui/material";
// import { getTeachers } from '../../services/api'; // Giả sử có service gọi API

const TeachersPage = () => {
  const [teachers, setTeachers] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchTeachers = async () => {
      try {
        setLoading(true);
        setError(null);
        // TODO: Gọi API thực tế để lấy danh sách giảng viên
        // const response = await getTeachers();
        // setTeachers(response.data);

        // Dữ liệu giả lập
        const mockTeachers = [
          {
            id: 1,
            name: "Nguyễn Văn A",
            email: "a.nv@example.com",
            department: "Công nghệ thông tin",
            subjects: ["Lập trình Web", "Cơ sở dữ liệu"],
          },
          {
            id: 2,
            name: "Trần Thị B",
            email: "b.tt@example.com",
            department: "Toán ứng dụng",
            subjects: ["Giải tích 1", "Xác suất thống kê"],
          },
          {
            id: 3,
            name: "Lê Văn C",
            email: "c.lv@example.com",
            department: "Vật lý kỹ thuật",
            subjects: ["Vật lý 1", "Điện tử cơ bản"],
          },
        ];
        await new Promise((resolve) => setTimeout(resolve, 1000)); // Giả lập độ trễ mạng
        setTeachers(mockTeachers);
      } catch (err) {
        console.error("Lỗi khi tải danh sách giảng viên:", err);
        setError("Không thể tải danh sách giảng viên. Vui lòng thử lại sau.");
      } finally {
        setLoading(false);
      }
    };

    fetchTeachers();
  }, []);

  if (loading) {
    return (
      <Box
        sx={{
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          height: "80vh",
        }}
      >
        <CircularProgress />
      </Box>
    );
  }

  if (error) {
    return (
      <Box sx={{ padding: 3 }}>
        <Typography color="error">{error}</Typography>
      </Box>
    );
  }

  return (
    <Box sx={{ padding: 3 }}>
      <Typography variant="h4" gutterBottom>
        Thông tin Giảng viên
      </Typography>
      <Paper sx={{ width: "100%", overflow: "hidden" }}>
        <TableContainer sx={{ maxHeight: 600 }}>
          <Table stickyHeader aria-label="sticky table">
            <TableHead>
              <TableRow>
                <TableCell sx={{ fontWeight: "bold" }}>STT</TableCell>
                <TableCell sx={{ fontWeight: "bold" }}>Họ và tên</TableCell>
                <TableCell sx={{ fontWeight: "bold" }}>Email</TableCell>
                <TableCell sx={{ fontWeight: "bold" }}>Khoa</TableCell>
                <TableCell sx={{ fontWeight: "bold" }}>
                  Môn học phụ trách
                </TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {teachers.length === 0 ? (
                <TableRow>
                  <TableCell colSpan={5} align="center">
                    Không có dữ liệu giảng viên.
                  </TableCell>
                </TableRow>
              ) : (
                teachers.map((teacher, index) => (
                  <TableRow
                    hover
                    role="checkbox"
                    tabIndex={-1}
                    key={teacher.id}
                  >
                    <TableCell>{index + 1}</TableCell>
                    <TableCell>{teacher.name}</TableCell>
                    <TableCell>{teacher.email}</TableCell>
                    <TableCell>{teacher.department}</TableCell>
                    <TableCell>{teacher.subjects.join(", ")}</TableCell>
                  </TableRow>
                ))
              )}
            </TableBody>
          </Table>
        </TableContainer>
      </Paper>
    </Box>
  );
};

export default TeachersPage;
